import React from 'react';
import LocationOnIcon from '@material-ui/icons/LocationOn';
import TodayIcon from '@material-ui/icons/Today';
import MonetizationOnIcon from '@material-ui/icons/MonetizationOn';
import "./SmallBox.css";
import { Button } from '@material-ui/core';

function SmallBox({title, location, timestamp, target}) {
    return (
        <div className = "smallBox">
            <h1>{title}</h1>
            <p className = 'target'> <MonetizationOnIcon style = {{ color: "green" }} fontSize = "inherit" /> {target} dollars left</p>
            <p className = "location"> <LocationOnIcon style = {{ color: "red" }} fontSize = "inherit" />{location} </p>

            <Button> Manage </Button>
        </div>
    )
}

export default SmallBox
